import React from 'react';
import { Avatar, Box } from '@mui/material';

function RuneImages({ runes }) {
  return (
    <Box display="flex" gap={0.5}>
      {runes.map((runeStyle, index) => (
        <Box key={index} display="flex" gap={0.5}>
          {/* Display the main rune style */}
          <Avatar
            src={`https://ddragon.leagueoflegends.com/cdn/img/${runeStyle.styleIcon}`}
            alt={`Rune Style ${runeStyle.style}`}
            sx={{ width: 32, height: 32 }}
          />
          {/* Display each rune selection within the style */}
          {runeStyle.selections.map((selection, i) => (
            <Avatar
              key={i}
              src={`https://ddragon.leagueoflegends.com/cdn/img/${selection.icon}`}
              alt={`Rune ${selection.id}`}
              sx={{ width: 32, height: 32 }}
            />
          ))}
        </Box>
      ))}
    </Box>
  );
}

export default RuneImages;
